RunService.RenderStepped:Connect(function(dt)t+=dt if t>frames[#frames].Time then cam.CameraType=Enum.CameraType.Custom hum.AutoRotate=true return end while idx<#frames and t>=frames[idx+1].Time do idx+=1 end if idx>=#frames then return end local a=frames[idx] local b=frames[idx+1] local alpha=(t-a.Time)/(b.Time-a.Time) cam.CFrame=a.CFrame:Lerp(b.CFrame,alpha) cam.FieldOfView=a.FOV+(b.FOV-a.FOV)*alpha local pos=a.Pos:Lerp(b.Pos,alpha) local flat=Vector3.new(cam.CFrame.LookVector.X,0,cam.CFrame.LookVector.Z).Unit if flat.Magnitude>0 then hrp.CFrame=CFrame.new(pos,pos+flat*10) end hum:Move(a.Move:Lerp(b.Move,alpha),true) hrp.AssemblyLinearVelocity=a.Vel:Lerp(b.Vel,alpha) if (alpha<0.5 and a.Jump)or(alpha>=0.5 and b.Jump)then hum.Jump=true end end)